pragma solidity ^0.4.8;

import "./owned_v2.sol";
import "../../contracts/base/timestamped.sol";
import "./mortal_v2.sol";
import "./TimeLineDocument_v2.sol";

/**
 * Base Contract for a TimeLine which is a cohesive linked list of documents that creates an
 * immutable history. The basic principles of a Timeline is that the data it stores can 
 * never be altered but new timeline documents can be appended in order to build more history.
 *
 * Copyright (c) 2017 Cognate, Inc.
 */
contract TimeLine_v2 is timestamped, owned_v2(msg.sender), mortal_v2 {

    bytes32 private _interfaceID = 0x79056e9bb24f897d7f885dacdb2d506599944c0cdfd6b7495eb7f3ea624ac5af;

    TimeLineDocument_v2 public next;

    function append(TimeLineDocument_v2 _next) external onlyOwner {
        if(_next.interfaceID() != interfaceID()) throw;

        if(next == address(0)) {
            next = _next;
        } else {
            TimeLineDocument_v2 last = next;
            while(last.next() != address(0)) {
                last = last.next();
            }

            last.append(_next);
        }
    }

    function interfaceID() public constant onlyOwner returns (bytes32) {
        return _interfaceID;
    }
}
